import './App.css';
import ChatBox from './Components/ChatBox';
import { BrowserRouter, Routes, Route } from "react-router-dom"
// import EventsCard from './Components/EventsCard';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route />>
      </Routes>
      </BrowserRouter>
      {/* <EventsCard /> */}
      <ChatBox />
    </div>
  );
}

export default App;
